            <div className="col-md-6"><VideoSub text={text} /></div>
            <div className="col-md-6"><VideoSub text={text} /></div>
            <div className="col-md-6"><VideoSub text={text} /></div>
            <div className="col-md-6"><VideoSub text={text} /></div>
            </div>
           </div>
       </div>
       <Button text="Send" buttonStyle={buttonStyle} />

   </div>
   </div>
  );
  export default Video;
